    {
      "type": "text",
      "text": "Alert! Currency rate is falling against dollar! It's at ${currentRate} now."
    }
  ]
}

function invoke(msg)         {

	var cachedval = parseFloat(msg.get("cachedRate"));
	var sellingrate = parseFloat(msg.get("currentRate"));
	var difference = 0; 
	if (cachedval > sellingrate) {
		difference = cachedval - sellingrate;
	} 
	else {
		difference = sellingrate - cachedval;
	}
	var perVal = (difference/ ((cachedval+sellingrate) /2)) * 100; 
	if (perVal > 2) {
		return true;
	}
	else {
		return false;
	}
}

